import React from "react";
import { NavLink } from "react-router-dom";

const Analytics = () => {
    return (
        <div>
         <NavLink to='/journal'>
            Create New Journal Entry
        </NavLink>
        <NavLink to='/archived-thoughts'>
            Thoughts let go
        </NavLink>
        <NavLink to='/active-thoughts'>
            Thoughts let go
        </NavLink>
        </div>
    )
}

export default Analytics
